import React from 'react'
import OnOffClasses from './OnOff.module.css'

type OnOffPropsType = {
    status: boolean
}

export function OnOff(props: OnOffPropsType) {
    return (
        <div className={OnOffClasses.block}>
            {props.status && <button className={OnOffClasses.on}>ON</button>}
            {<button>OFF</button>}
            {<div></div>}
        </div>
    )
}
